// pages/HomePage/Services.js
import React from "react";
import ServiceCard from "../../components/HomePage/ServiceCard";
import "../../styles/HomePage/Services.css";

const services = [
  { title: "Consult a Doctor", icon: "consultation.svg", description: "Video/audio consultation with top doctors." },
  { title: "Order Medicines", icon: "pharmacy.svg", description: "Affordable generic medicines delivered to your door." },
  { title: "Book Lab Tests", icon: "lab-test.svg", description: "Book tests and get reports from trusted labs." },
  { title: "Book Mobile Van", icon: "van.svg", description: "Health checkups at your doorstep in rural areas." },
];

const Services = () => {
  return (
    <section className="services-section">
      <h2>Our Services</h2>
      <div className="services-grid">
        {services.map((service, index) => (
          <ServiceCard key={index} title={service.title} icon={service.icon} description={service.description} />
        ))}
      </div>
    </section>
  );
};

export default Services;
